class Solution {
public:
    vector<vector<int> > permuteUnique(vector<int> &num) {
        set<vector<int> > s;
        sort(num.begin(), num.end());
        s.insert(num);
        while (next_permutation(num.begin(), num.end())) {
            s.insert(num);
        }
        vector<vector<int> > result;
        set<vector<int> >::iterator iter = s.begin();
        while (iter != s.end()) {
            result.push_back(*iter++);
        }
        return result;
    }
};

